import React from 'react';
import './navbar.css';

function Navbar() {
  return (
    <div className='navbar-wrapper'>
      <div className='navbar-container'>
        <div className='profile-photo-container' />
        <div className='item-container' />
      </div>
      <div className='navbar-container'>
        <div className='item-container' />
      </div>
    </div>
  );
}

export default Navbar;
